import logo from './logo.svg';
import './App.css';

function App() {
  return (
      class ClassComponent extends React.Component {
        constructor(props) {
          super(props);
          this.state = {
            count: 0
          };
        }

        render() {
          return (
              <div>
                <p>count: {this.state.count} times</p>
                <button onClick={() => this.setState({ count: this.state.count + 1 })}>
                  Click
                </button>
              </div>
          );
        }
      }
  );
}

export default App;
